import { Component } from "react";

class Count extends Component{
    state = {
        count: 0
    }

    increment = ()=>{
        this.setState({
            count: this.state.count+2
        })
    }
    render(){
        return(

        <div>
            <p>{this.state.counter}</p>
            <button onClick={this.increment}>Inctement</button>
        </div>
        )
    }
}

export default Count;
